title:
El domingo 28 de Julio de 2019 di mi primera charla de veganismo, algo que jamás pensé hacer, pero me animé, no por mi, por ustedes. Puro me contactó para contarles que me inspira ser vegana. Son tantas cosas que podría escribir miles de palabras pero definitivamente lo que más me inspira es ayudar, tratar de salir de mi zona de confort para llevar un mensaje de empatía y hacerles ver y sentir a las personas que ser veganx no es tan complicado, que se puede, hay mil opciones y variedades, sabores, aromas, el veganismo te abre un mundo.
Gracias a las más de 60 personas que fueron a mi primera charla y me ayudaron a ayudarlos, gracias por reírse, divertirse y entender que no es tan difícil una vez que entendés las benditas trazas. 
@puroteinspira es una marca hermosa que busca generar un impacto positivo al no usar cuero animal y reciclar telas para reducir residuos.
